webpackJsonp([0xb32cd3e25788],{3043:function(e,n){e.exports={data:{challengeNode:{title:"Problem 263: An engineers' dream come true",description:["Consider the number 6. The divisors of 6 are: 1,2,3 and 6.","Every number from 1 up to and including 6 can be written as a sum of distinct divisors of 6:","1=1, 2=2, 3=1+2, 4=1+3, 5=2+3, 6=6.","A number n is called a practical number if every number from 1 up to and including n can be expressed as a sum of distinct divisors of n.","","",'A pair of consecutive prime numbers with a difference of six is called a sexy pair (since "sex" is the Latin word for "six"). The first sexy pair is (23, 29).',"","","We may occasionally find a triple-pair, which means three consecutive sexy prime pairs, such that the second member of each pair is the first member of the next pair.","","","We shall call a number n such that :","(n-9, n-3), (n-3,n+3), (n+3, n+9) form a triple-pair, and ","the numbers n-8, n-4, n, n+4 and n+8 are all practical,","","an engineers’ paradise.","","","Find the sum of the first four engineers’ paradises."],challengeType:5,fields:{slug:"/coding-interview-prep/project-euler/problem-263-an-engineers-dream-come-true",blockName:"Project Euler",tests:[{text:"<code>euler263()</code> should return 2039506520.",testString:"assert.strictEqual(euler263(), 2039506520, '<code>euler263()</code> should return 2039506520.');"}]},required:[],files:{indexhtml:null,indexjs:{key:"indexjs",ext:"js",name:"index",contents:"function euler263() {\n  // Good luck!\n  return true;\n}\n\neuler263();",head:"",tail:""},indexjsx:null}}},pathContext:{challengeMeta:{introPath:"",template:null,required:[],nextChallengePath:"/coding-interview-prep/project-euler/problem-264-triangle-centres",id:"5900f4741000cf542c50ff86"},slug:"/coding-interview-prep/project-euler/problem-263-an-engineers-dream-come-true"}}}});
